import Bounce from "react-reveal/Flip"

export default function Intro() {
  return (
    <header
    className="jumbotron text-left"
    style = {{marginBottom:0, backgroundColor:"whitesmoke"}}
    >
        <h1 style={{display:"inline"}}>Hola!! This is<Bounce style={{display:"inline"}}>Arthy Umapathy</Bounce></h1>
        <p>I am Software Professional and I love to create and build applications</p>

    </header>
  );
}
